(14, 'c9fe96dc-e7d5-445a-ac60-5676eb046b86', 2, 'Our Values', '', '', '<div class=\"our-values\">\r\n   <div class=\"container \">\r\n      <div class=\"value-top-mobile\">\r\n         <h2>Our Values</h2>\r\n         <p>Like Steve Jobs quotes, “Design is not just what it looks like and feels like. Design is how it works”. We always try to make a great output by this culture:</p>\r\n      </div>\r\n      <div class=\"row align-items-center flip-column\">\r\n         <div class=\"col-lg-5 col-md-6 col-12\">\r\n            <div class=\"value-top-desktop\">\r\n               <h2>Our Values</h2>\r\n               <p>Like Steve Jobs quotes, “Design is not just what it looks like and feels like. Design is how it works”. We always try to make a great output by this culture:</p>\r\n            </div>\r\n            <ul>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Fast Delivery</li>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Hungry for Explorations</li>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Teamwork Always</li>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Communication is the Key</li>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Weekly Evaluation</li>\r\n               <li><img src=\"http://localhost:4003/images/tick.png\" alt=\"\">Update for th Trend</li>\r\n            </ul>\r\n         </div>\r\n         <div class=\"col-lg-7 col-md-6 col-12 \"><img class=\"puzzle\" src=\"http://localhost:4003/images/puzzle.png\" alt=\"Image broken\"></div>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 09:02:18', '2025-03-28 09:02:18', NULL, 3, '', '', 4),
(15, '3509b3e1-6208-4353-a941-d594395626c9', 2, 'The future of work', '', '', '<div class=\"future-work mbl-view my-5\">\r\n   <div class=\"container\">\r\n      <div class=\"row align-items-center flip-column\">\r\n         <div class=\"col-lg-5 col-md-5 col-12\"><img class=\"business-woman\" src=\"http://localhost:4003/images/smiling-young-asian-businesswoman 1.png\" alt=\"Image broken\"></div>\r\n         <div class=\"col-lg-7 col-md-5 col-12 building-ecosystem-text left-align-text p-0\">\r\n            <h2>The future of work</h2>\r\n            <p class=\"future-text\">What is the future of work? To find out, look no further than your own home. Connect with colleagues from across the globe while doing work that matters.</p>\r\n         </div>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 09:03:34', '2025-03-28 09:03:34', NULL, 3, '', '', 5),
