(17, 'c3859c8e-9409-4727-99be-6ee324adea5f', 3, 'Boost Your Business With Invoice Management Now', '', '', '<div class=\"boost-bussiness\">\r\n   <h2>Boost Your Business With Invoice Management  Now</h2>\r\n   <p>Join us now and see what the hype is all about.</p>\r\n   <a class=\"getstarted\" href=\"\">Get Started <img class=\"bluearrow\" alt=\"Image broken\" src=\"http://localhost:4003/images/blue_arrow.png\"></a>\r\n</div>', 1, '2025-03-28 09:34:55', '2025-03-28 09:34:55', NULL, 3, '', '', 2),
(18, 'c9cc8f61-b156-409b-a3c2-e28b11abf4f2', 3, 'Features Block', '', '', '<div class=\"features\">\r\n   <div class=\"container\">\r\n      <div class=\"row feature-background\">\r\n         <div class=\"col-lg-6\"></div>\r\n         <div class=\"col-lg-6 feature-list left\">\r\n            <h6>Custom Design</h6>\r\n            <h2>Create customizable invoices</h2>\r\n            <p>Each invoice is beautifully formatted, making you look like the professional you are. Use a standard invoice template or add a logo, choose colors, and include your brand with&nbsp;Raise Invoice invoicing software.</p>\r\n         </div>\r\n      </div>\r\n      <div class=\"row feature-background\">\r\n         <div class=\"col-lg-6\"></div>\r\n         <div class=\"col-lg-6 feature-list \">\r\n            <h6>Custom Design</h6>\r\n            <h2>Send an invoice on the spot</h2>\r\n            <p>When you can send an invoice straight after you complete a job, you’ll save time and get paid faster.</p>\r\n         </div>\r\n      </div>\r\n      <div class=\"row feature-background\">\r\n         <div class=\"col-lg-6\"></div>\r\n         <div class=\"col-lg-6 feature-list left\">\r\n            <h6>Custom Design</h6>\r\n            <h2>Send an invoice via email, Facebook Messenger, and more</h2>\r\n            <p>Share your invoices via text, email, or other platforms like WhatsApp and Facebook Messenger.</p>\r\n         </div>\r\n      </div>\r\n      <div class=\"row feature-background\">\r\n         <div class=\"col-lg-6\"></div>\r\n         <div class=\"col-lg-6 feature-list\">\r\n            <h6>Custom Design</h6>\r\n            <h2>Stay on top of your invoices with status tracking and reminders</h2>\r\n            <p>Get notified when clients view your invoices. Set up automatic reminders to stop chasing unpaid invoices.</p>\r\n         </div>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 09:36:25', '2025-03-28 09:36:25', NULL, 3, '', '', 3),
(19, '2708f5f7-eb24-4542-b525-52ac3a934045', 3, 'Trusted and Best Financial Service', '', '', '<div class=\"financial-service\">\r\n   <div class=\"container\">\r\n      <div class=\"financial-service-head mb-5\">\r\n         <h2>Trusted and Best Financial Service</h2>\r\n         <p>We offer the best financial services for you, in terms that our services are secure and easy to be used</p>\r\n      </div>\r\n      <div class=\"financial-service-body\">\r\n         <div class=\"financial-lft\">\r\n            <div class=\"financial-lft-img\"><img class=\"mb-5\" alt=\"Image broken\" src=\"http://localhost:4003/images/icon.png\"></div>\r\n            <div class=\"financial-lft-cntnt\">\r\n               <h4>Safe and Reliable</h4>\r\n               <p>We guarantee your data, transaction history, balance secured under our security system.</p>\r\n            </div>\r\n         </div>\r\n         <div class=\"financial-lft\">\r\n            <div class=\"financial-lft-img\"><img class=\"mb-5\" alt=\"Image broken\" src=\"http://localhost:4003/images/icon2.png\"></div>\r\n            <div class=\"financial-lft-cntnt\">\r\n               <h4>Easy To Use</h4>\r\n               <p>We have all feature you need. We profide all planing, saving, and transaction. It’s all easy to use.</p>\r\n            </div>\r\n         </div>\r\n         <div class=\"financial-lft\">\r\n            <div class=\"financial-lft-img\"><img class=\"mb-5\" alt=\"Image broken\" src=\"http://localhost:4003/images/icon3.png\"></div>\r\n            <div class=\"financial-lft-cntnt\">\r\n               <h4>Integrations</h4>\r\n               <p>Connect you to every bank and financial platform in more than 120 countries around the world for free</p>\r\n            </div>\r\n         </div>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 09:36:56', '2025-03-28 09:36:56', NULL, 3, '', '', 4),
