(21, 'cece79e0-17bd-4c99-a54d-e161b545c7c7', 4, 'Make Invoicing Simple with us', '', '', '<div class=\"make-invoicing\">\r\n   <div class=\"container\">\r\n      <h2 class=\"my-5\">Make Invoicing Simple with us</h2>\r\n      <div class=\"make-invoicing-body\">\r\n         <div class=\"simple-invoice\">\r\n            <h2>01</h2>\r\n            <h4>Handle all your admin work in minutes</h4>\r\n            <p>Easy-to-use tools to attach expenses, schedule appointments, and track &amp; bill hours.</p>\r\n         </div>\r\n         <div class=\"simple-invoice\">\r\n            <h2>02</h2>\r\n            <h4>See the big picture with business reports</h4>\r\n            <p>Track how your business is doing and get critical insights with easy-to-use charts and graphs.</p>\r\n         </div>\r\n         <div class=\"simple-invoice\">\r\n            <h2>03</h2>\r\n            <h4>Spend less time managing your books</h4>\r\n            <p>Sync all of your invoicing and payments data to QuickBooks or Xero for your tax preparer.</p>\r\n         </div>\r\n         <div class=\"simple-invoice\">\r\n            <h2>04</h2>\r\n            <h4>Take care of business on the spot</h4>\r\n            <p>With the&nbsp;Invoice2go&nbsp;app (available on the web, iOS, and Android) all of your information is synced&nbsp;</p>\r\n         </div>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 09:58:31', '2025-03-28 09:58:31', NULL, 3, '', '', 1),
(22, 'a61ab3dc-3e8d-47a1-bba0-ef3c429a7a0f', 5, 'Banner Block', '', '', '<div class=\"career-banner\">\r\n   <div class=\"container\">\r\n      <div class=\"banner-text\">\r\n         <div>\r\n            <h6>Careers</h6>\r\n            <h3>Join Our Team and Shape the Future</h3>\r\n         </div>\r\n         <p>If you\'re passionate about driving change, pushing boundaries, and making an impact, we want to hear from you</p>\r\n      </div>\r\n   </div>\r\n</div>', 1, '2025-03-28 10:05:47', '2025-03-28 10:06:27', NULL, 3, '', '', 1),
